  let today = new Date().getFullYear()
  settodaydate(today);
  const onChange = ( date,dateString) => {
    let datee= ( date,dateString);
    setdate(datee);
    console.log(datee);
    console.log(today);
  };
  return (
    <div className="App">
      <h1>Your DOB is : {date}</h1>
      <h1>Today date is : {today}</h1>
    <DatePicker picker="date" onChange={onChange} format="DD/MM/YYYY"/>

    </div>
  );
}

export default App;
